import React from 'react';
import "../../styles/Profile.css";
import PatientNavBar from '../../components/PatientNavBar';
import PatientFooter from '../../components/PatientFooter';



const Profile = () => {
    const [user, setUser] = useState(null);
    const [isError, setIsError] = useState(false);
    const [message, setMessage] = useState('');

    useEffect(() => {
        fetchUser();
      }, []);
    const fetchUser = async () => {
    try {
        const response = await fetch("http://localhost:8080/patientprofile");
        if (response.ok) {
        const data = await response.json();
        setUser(data);
        } else {
        setIsError(true);
        }
    } catch (error) {
        console.error('Error fetching user:', error);
        setIsError(true);
    }
    };

    const handleLogout = async () => {
    try {
        const response = await fetch("http://localhost:8080/patientlogout", {
        method: 'POST',
        });

        if (response.status === 200) {
        setMessage('Logged out successfully');
        window.location.href = '/patlogin';
        } else if (response.status === 401) {
        setMessage('No user is currently logged in');
        } else {
        setMessage('An error occurred');
        }
    } catch (error) {
        setMessage('An error occurred');
    }
    };




  return (
    <div className="profile-container" id="container">
        <PatientNavBar />
        <div className="info-container"> 
            <div className="p-steps">
                    <div className="profile-card">
                        <br />
                        <br />
                        <br />
                        <h1>Patient Profile</h1>
                        <p><b>Username:</b><br /><h5>{user.firstName}</h5></p>
                        <p><b>Name:</b><br /><h5>John P. Doe</h5></p>
                        <p><b>Contact Number:</b><br /><h5>09XX-XXX-XXXX</h5></p>
                        <p><b>Email:</b><br /><h5>johndoe@sample.com</h5></p>
                    </div>
                    <div className="profile-card">
                        <br />
                        <br />
                        <br />
                        <br />
                        <br />
                        <br />
                        <p><b>Age:</b><br /><h5>XX</h5></p>
                        <p><b>Sex:</b><br /><h5>Sample</h5></p>
                        <p><b>Birthday:</b><br /><h5>00 / 00 / 0000</h5></p>
                        <p><b>Address:</b><br /><h5>Lorem St. Ipsum Avenue, Manila, Philippines</h5></p>
                    </div>
                    <div className="profile-card">
                        <br />
                        <br />
                        <br />
                        <br />
                        <br />
                        <br />
                        <p><b>PhilHealth ID no:</b><br /><h5>0000-00000-00000</h5></p>
                        <p><b>PWD ID no:</b><br /><h5>0000-00000-00000</h5></p>

                    </div>
                    <div className="profile-card" style={{marginTop:'100px'}}>
                        <img
                            src={require('../../images/profilepic.jpg')}
                            alt='profilepic'
                            style={{ maxWidth: '80%', maxHeight: '80vh', margin: 0}}
                        />
                    </div>
            </div>
            <div className="steps"  style={{marginTop:'-10px'}}>
                <div className="step-card">

                    <img
                        src={require('../../images/vision.png')}
                        alt='vision'
                        style={{ maxWidth: '100%', maxHeight: '100hw', margin: 0}}
                    />
                </div>
                <div className="step-card" >
                    <br />
                    <br />
                    <br />
                    <br />
                    <p>At 'Doc Click Connect,' we're not just a platform for scheduling appointments;
                    <br/>we're your dedicated healthcare partner. Your well-being is our priority,
                    <br/>and we believe that staying informed is a crucial aspect of maintaining good health.
                    <br/>Whether it's guidance on managing chronic conditions, maintaining a healthy lifestyle, 
                    <br/>or understanding the latest medical advancements, we're here to empower you with knowledge.
                    <br />
                    <br /> Our commitment to your health goes beyond appointments. We're here to keep you informed 
                    <br />and support your journey to a healthier you. Check back regularly for updates, and feel 
                    <br />free to reach out to your healthcare provider for personalized advice and recommendations.</p>
                </div>
            </div>
        </div>
        <PatientFooter />
    </div>
  );
};

export default PatientProfile;
